  false,\n\t\"url\": null,\n\t\"notes\": \"Economics: National Ocean Watch (ENOW)
  contains annual time-series data for over 400 coastal counties, 30 coastal states,
  8 regions, and the nation, derived from the Bureau of Labor Statistics and the Bureau
  of Economic Analysis. It describes six economic sectors that depend on the oceans
  and Great Lakes and measures four economic indicators: Establishments, Employment,
  Wages, and Gross Domestic Product (GDP). Nonemployer Statistics for Economics: National
  Ocean Watch (ENOW NES) contains annual time-series data for over 400 coastal counties,
  30 coastal states, and the nation, derived from the United States Census Bureau.
  ENOW NES data report the number of nonemployer establishments and gross receipts,
  within the six sectors of the ocean and Great Lakes economy.\",\n\t\"license_title\":
